//pull data from catalog item form variables
var ci = current.variables.configuration_item;
var vm = current.variables.virtual_machine;
var assignGrp = current.cat_item.group;
var appGrp = current.cat_item.u_approver_group;
var desc = current.variables.description;
var desc2 = current.variables.detailed_notes;

//if data exists, populate it into the RITM
if (vm){current.configuration_item = vm;}
if (ci){current.configuration_item = ci;}
if(desc){current.description = desc;}
if(desc2){current.description = desc2;}
if (assignGrp){current.assignment_group = assignGrp;}

//The approval is only required if there is a group named in the cat item "Approver Group"
if(appGrp){	
	current.approval = 'Requested';
}else{
	current.approval = 'Not Required';
}

